import React from "react";
import { Container } from "react-bootstrap";
import { useSelector } from "react-redux";

const Favoruite = () =>{

    const fav = useSelector((state) => state.cart.fav)
    return(
        <div>
            <Container className="favcont">
                {fav.map((favs) => (
                    <div> {favs.name}</div>
                ))}
            </Container>
        </div>
    )
}

export default Favoruite;
